            "rek_pid": "UQ:356418",
            "rek_title": "Employee green behavior: a theoretical framework, multilevel review, and future research agenda",
            "rek_description": "We propose a conceptual model based on personenvironment interaction, job performance, and motivational theories to structure a multilevel review of the employee green behavior (EGB) literature and agenda for future research. We differentiate between required EGB prescribed by the organization and voluntary EGB performed at the employees discretion. The review investigates institutional-, organizational-, leader-, team-, and employee-level antecedents and outcomes of EGB and factors that mediate and moderate these relationships. We offer suggestions to facilitate the development of the field, and call for future research to adopt a multilevel perspective and to investigate the outcomes of EGB.",
