            "rek_pid": "UQ:614782",
            "rek_title": "Smoking Cessation interventions for lung cancer patients",
            "rek_description": "Worldwide, lung cancer contributes to over 1.4 million deaths per year. Smoking cessation is strongly recommended in clinical practice guidelines for lung cancer management, yet evidence suggests a translational gap between evidence and practice. There are significant health benefits following smoking cessation even after a short period of time. Long-term implications for lung cancer patients include improvements in quality of life, reductions in postoperative complications and reductions in 12-month mortality. Evidence suggests that combining pharmacotherapy, in particular varenicline tartrate (varenicline), with cognitive and behavioral interventions offers the best opportunity for successful long-term abstinence. This review summarizes the latest evidence for smoking cessation interventions in lung cancer patients, identifies gaps in current clinical practice and highlights priority areas for future research.",
